import  React from "react";
import './App.css';
import Home from "./pages/Home";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Route>
        <Switch>
          <Route Path="/search">
            <h1>this is the search Page</h1>
          </Route>
          <Route Path=""></Route>
        </Switch>
      </Route>
    </div>
  );

}

export default App;
